Anno: 15 settembre 1975
Genere: Rock progressivo

Pink Floyd followed the commercial breakthrough of Dark Side of the Moon with Wish You Were Here, a loose concept album about and dedicated to their founding member Syd Barrett. The record unfolds gradually, as the jazzy textures of &quot;Shine on You Crazy Diamond&quot; reveal its melodic motif, and in its leisurely pace, the album shows itself to be a warmer record than its predecessor. Musically, it's arguably even more impressive, showcasing the group's interplay and David Gilmour's solos in particular. And while it's short on actual songs, the long, winding soundscapes are constantly enthralling. 

